Patch Set 4:

@Ihar it's kind of an anti-dependency, ie we want a version < 2.

The main reason was the introduction of SSL certificate checking by default with version >=2 of swiftclient. This could potentially break existing glance installs (image upload/download) where swift's SSL certs were not 100% kosher.

Patch Set 4:

@Stuart, do you have any specific issue in mind? We use swiftclient 2.0.2 in RHEL-OSP 4 for quite some time with no obvious issues.

The problem with that version pinned is that other projects in havana depend on swiftclient >= 2.0.0, f.e. swift itself requires >= 2.2.0. So it's impossible to maintain requirements in havana now.
